export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},LM4VXcY7UH:{data:{id:626,attributes:{imdbId:"tt0970411",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTU3MDE4MDU1Nl5BMl5BanBnXkFtZTcwNDM2NDI5MQ@@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.5\u002F10"},{Source:"Rotten Tomatoes",Value:"54%"},{Source:"Metacritic",Value:"58\u002F100"}],item_lang:{data:{id:1289,attributes:{title:"City of Ember",plot:"When mankind is about to come to an end, a group of scientists decide to create and populate a city deep underground. The City of Ember is to last for two hundred years, after which its inhabitants are to retrieve from a strong box instructions to return to the surface. Over time, however, the message is lost and life in Ember is rapidly deteriorating. Their power supply is failing and food is being rationed. It's left to two young teens to unearth the secret of Ember and to lead the way out.",slug:"city-of-ember"}}},books:{data:[{id:4296,attributes:{title:d,description:"In the year 241, twelve-year-old Lina trades jobs on Assignment Day to be a Messenger to run to new places in her decaying but beloved city, perhaps even to glimpse Unknown Regions.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zxvhAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2003-01-01",publisher:"Yearling Books",subtitle:"Book 1"}},{id:4297,attributes:{title:d,description:"Extensive reading improves fluency and there is a real need in the ELT classroom for motivating, contemporary graded material that will instantly appeal to students. City of Ember is adapted from American author Jeanne DuPrau's novel for teenagers and a film version is due for release in autumn 2008.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OFpdXwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2008-01-01",publisher:h,subtitle:h}},{id:4298,attributes:{title:"The City of Ember Complete Series",description:"With more than 3.5 million copies sold, the City of Ember books are modern-day classics. Lina and Doon's heart-pounding journey to save their people has captivated readers around the world, and the four adventures are bound together here for the very first time! Escape the Dark. Discover the Adventure. The city of Ember was built as a last refuge for the human race. But now with terrifying blackouts sweeping through the streets, Lina and Doon know it’s only a matter of time before the lights go out and never come back on again. When Lina finds part of an ancient message, she and Doon explore long-forgotten parts of their dying city as they race to solve the mystery. If they succeed, they will have to convince everyone to follow them into danger and an exciting new world. But if they fail? The lights will burn out and the darkness will close in forever. The series begins with the groundbreaking dystopian novel The City of Ember, the story of a girl, a boy, and their beleaguered city. Through the sequel, The People of Sparks, the satisfying conclusion, The Diamond of Darkhold, and the prequel,The Prophet of Yonwood, author Jeanne DuPrau offers a vision of hope that, while sometimes flickering against the darkness, ultimately shines through, like the bright dawning of a new world.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_FMKDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2016-08-23",publisher:f,subtitle:"The City of Ember; The People of Sparks; The Diamond of Darkhold; The Prophet of Yonwood"}},{id:4299,attributes:{title:d,description:i,thumbnail:j,authors:[b,k],firstBook:e,published:l,publisher:f,subtitle:m}},{id:4300,attributes:{title:d,description:i,thumbnail:j,authors:[b,k],firstBook:e,published:l,publisher:f,subtitle:m}}]}}},meta:{}}},prerenderedAt:1694069481110}}("movie","Jeanne DuPrau","series","The City of Ember",null,"Random House Books for Young Readers",1,"","In the spring 2003, kids, parents, teachers, librarians—whole communities—discovered and fell in love with Jeanne DuPrau's story about a doomed city, and the two children who found a way out. Nearly 10 years later, that story, The City of Ember, is a bona fide classic, with over 1.7 million copies sold. Now experience Jeanne DuPrau's vision anew as artist Niklas Asker faithfully brings to life the glare of the lamps, the dinginess of the streets, and the brilliance of the first sunrise.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gTlWv7GrflcC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","Dallas Middaugh","2012-09-25","The Graphic Novel"))